INSERT INTO `block_custom` VALUES (1,'<p><a href=\"http://www.facebook.com/pages/Boulder-Creek-Golf-Club-Belmont-MI/135317921057\">Find us on Facebook<img alt=\"\" src=\"/sites/default/files/ficon.png\" style=\"width: 22px; height: 27px; margin-left: 3px; margin-right: 3px;\" /></a></p>','Main Menu Social Media Link','wysiwyg'),(2,'<p>5750 Brewer Ave. NE Belmont, MI 49306</p>','Footer Left - Address','wysiwyg'),(3,'<p><a href=\"/driving-directions\" target=\"_self\">Get Driving Directions<img alt=\"\" src=\"/sites/default/files/dicon.png\" style=\"width: 18px; height: 35px; margin-left: 3px; margin-right: 3px;\" /></a></p>','Footer Right - Driving Directions Link','wysiwyg'),(4,'<p></p>','GOLF LANDING PAGE BLOCK','full_html'),(5,'<p style=\"text-align: center;\"><a class=\"blue-btn\" href=\"/contact-us\">REQUEST INFORMATION</a></p><br /><p style=\"text-align: center;\"> or call</p><h3 style=\"text-align: center;\">(616) 363-1330</h3>','Contact Block','full_html'),(6,'<p>Tranquility, Natural Beauty and Golf.</p>','Slogan','wysiwyg'),(7,'<a href=\"/golf/online-tee-time\"><img alt=\"\" src=\"/sites/default/files/teetimeicon.png\" style=\"width: 36px; height: 30px; margin-left: 5px; margin-right: 5px;\" />BOOK TEE TIME ONLINE!</a><br /><p>or call <h4>(616) 363-1330</h4></p>','Tee Time Header','full_html'),(8,'<p style=\"text-align: center;\"><a class=\"blue-btn\" href=\"/golf/online-tee-time\" target=\"_self\">BOOK TEE TIME ONLINE</a></p><br /><p style=\"text-align: center;\">or call</p><h3 style=\"text-align: center;\">(616) 363-1330</h3>','Tee Time Block','full_html'),(9,'<p><img alt=\"\" src=\"/sites/default/files/ocard-image_03_0.jpg\" style=\"width: 120px; height: 45px;\" /></p><br /><p><a class=\"green-btn\" href=\"golf/online-scorecard\">ONLINE SCORECARD</a></p>','Online Scorecard Block','full_html'),(10,'<h2>TODAY&#39;S SPECIALS</h2>','RESTAURANT LANDING PAGE BLOCK','wysiwyg'),(11,'<p><strong>RESTAURANT HOURS<br />Tuesday - Friday: 11am - 8:30pm<br />Saturday: 4pm-9pm<br />Closed Sunday &amp; Monday</strong></p>','RESTAURANT HOURS BLOCK','wysiwyg'),(12,'<h2>YOUR EVENTS</h2> <h4>@ Boulder Creek</h4><br/><p>Boulder Creek\'s banquet room can accommodate groups from 25 to 200 in a setting that will make any event a sure success. Located in the lower level of the clubhouse with a walk-out patio, the banquet room is available for receptions, rehearsal dinners, company meetings and seminars, holiday parties and golf outings. A varied selection of menus are available for breakfasts, luncheons, and dinners. Service styles include sit-down lunches and dinners, buffets, and old fashioned &quot;on the grill&quot; picnics - sure to fit any group&#39;s needs.</p>','HOST EVENTS LANDING PAGE BLOCK','full_html'),(13,'<p style=\"text-align: center;\"><a class=\"blue-btn\" href=\"/contact-us\" target=\"_self\">REQUEST MORE INFORMATION</a></p><br /><p style=\"text-align: center;\">or call</p><h3 style=\"text-align: center;\">(616) 363-1330</h3>','HOST EVENTS LANDING PAGE CONTACT BLOCK','full_html');
/*!40000 ALTER TABLE `block_custom` ENABLE KEYS */;
UNLOCK TABLES;

