or.</p>','','full_html'),('node','golf_page',0,10,10,'und',0,'<h3>2012 Golf Membership Plans</h3><p>Golf memberships are good for calendar year they were purchased in.</p><p><strong>&nbsp;</strong></p><p><strong>Boulder Creek Partners Club*</strong></p><p>10 18-Hole Rounds with Cart = $450.00</p><p>20 18-Hole Rounds with Cart = $850.00</p><p>50 18-Hole Rounds with Cart = $2,000.00</p><p>&nbsp;</p><p><strong>Boulder Creek Senior Partners Club**</strong></p><p>10 18-Hole Rounds with cart = $250.00</p><p>10&nbsp;9-Hole Rounds with cart = $170.00</p><p>20 18-Hole Rounds with cart = $480.00</p><p>^10 18-Hole Rounds with cart at anytime = $350.00</p><p>&nbsp;</p><p>Reminder: Senior Partners Club 18 hole rounds must be used as 18 holes and <strong><em>cannot</em></strong> be split.&nbsp; We are now also offering a Senior Partners Club 9 hole package for those Seniors wanting to play 9 holes.</p><p>&nbsp;</p><p><strong>Boulder Creek Partners Club Unlimited Individual Partner</strong></p><p>Unlimited with cart = $1,800.00</p><p>Individual &amp; Spouse = $3,000.00</p><p>Add Children (17 &amp; Under) for $500.00 per person</p><p>&nbsp;</p><p><strong>2012 Promotions</strong></p><p><a href=\"/sites/default/files/2012_promotions_flier.pdf\" target=\"_blank\">Please click here to see promotions available.</a></p><p>&nbsp;</p><p>* Rounds are good anytime 7 days a week. Good After 12:00 PM on Holidays.</p><p>**Senior Rounds are good Monday-Friday before Noon, Holidays after 12:00pm</p><p>^Senior Anytime Partners are good any day of the week.</p><p>&nbsp;</p><p><strong>Range Membership Plans</strong></p><p>Boulder Creek Golf Club offers annual fees for the practice facility within scheduled operating hours. An individual plan is $275.00 and a family plan is $375.00. Members of the plan may hit unlimited range balls during range hours of operation. Guests of program participants must purchase range balls separately. Please inquire in the pro shop for more details.</p>','','wysiwyg'),('node','restaurant_page',0,12,12,'und',0,'<h3>RESTAURANT MENU</h3><p>&nbsp;</p><h3>GOLF OUTING MENU</h3><p>&nbsp;</p><h3>BEVERAGE MENU</h3><p><strong>BEER</strong></p><p>Draft:</p><p>Miller Lite - Pow Wow Pale Ale - Mt. Pleasant Brewing Co. Train Wreck</p><p>McSorley&#39;s Irish Lager - Bell&#39;s Oberon - Leinenkugel&#39;s Summer Shandy</p><p>Cans:</p><p>Miller High Life - Pabst Blue Ribbon - Carling&#39;s Black Label $2.00</p><p>Bud Light, Budweiser, Bud Light Lime, Coors Light, MGD 64, Miller Lite, Michelob Ultra - $3.00</p><p>Newcastle, Heineken, Corona, Labatt Blue, Labatt Blue Light, Shock Top, Leinenkugel&#39;s Summer Shandy &amp; Sunset Wheat - $3.50</p><p>Mike&rsquo;s Hard Lemonade, Lime, Cranberry - $4.00</p><p>Guinness Draft Can - $4.00</p><p>Fosters Oil Can (25.4oz), - $4.50</p>','','wysiwyg'),('node','restaurant_page',0,13,13,'und',0,'<p>ccdscds</p>','','wysiwyg'),('node','restaurant_page',0,14,14,'und',0,'<p>czcvdscv</p>','','wysiwyg'),('node','event',0,15,15,'und',0,'<p>onsectetur adipiscing elit. Nulla fringilla auctor nibh nec cursus. Phasellus quis felis vulputate mi dictum tristique. Nulla tristique magna sed nisi faucibus malesuada. Nam id eleifend tellus. Etiam et leo id est tempor scelerisque. Cras consequat porttitor tincidunt. Quisque feugiat orci pulvinar lacus auctor imperdiet. In neque elit, varius tempor dignissim eget, faucibus nec orci. Praesent nisl mi, consequat et vestibulum eu, pulvinar et ante. Vivamus fermentum dictum orci, ac pellentesque est porttitor et. In venenatis velit tortor. Sed aliquet orci quis nibh commodo elementum. Aenean dignissim pretium ante ac tincidunt. Nam diam dolor, adipiscing non ornare non, venenatis vel risus. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Vestibulum quis nibh dui, ac pellentesque tellus.</p>','','wysiwyg'),('node','event',0,16,16,'und',0,'<p>onsectetur adipiscing elit. Nulla fringilla auctor nibh nec cursus. Phasellus quis felis vulputate mi dictum tristique. Nulla tristique magna sed nisi faucibus malesuada. Nam id eleifend tellus. Etiam et leo id est tempor scelerisque. Cras consequat porttitor tincidunt. Quisque feugiat orci pulvinar lacus auctor imperdiet. In neque elit, varius tempor dignissim eget, faucibus nec orci. Praesent nisl mi, consequat et vestibulum eu, pulvinar et ante. Vivamus fermentum dictum orci, ac pellentesque est porttitor et. In venenatis velit tortor. Sed aliquet orci quis nibh commodo elementum. Aenean dignissim pretium ante ac tincidunt. Nam diam dolor, adipiscing non ornare non, venenatis vel risus. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Vestibulum quis nibh dui, ac pellentesque tellus.</p>','','wysiwyg'),('node','event',0,17,17,'und',0,'<p>sfgsf</p>','','wysiwyg'),('node','restaurant_special',0,19,19,'und',0,'<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.</p>','','wysiwyg'),('node','event',0,22,22,'und',0,'<p>Catering Test</p>','','wysiwyg'),('node','event',0,23,23,'und',0,'<p>Banquet Test</p>','','wysiwyg'),('node','restaurant_special',0,24,24,'und',0,'<p><img alt=\"\" src=\"/sites/default/files/Building3_0.JPG\" style=\"width: 400px; height: 148px;\" /></p><p>&nbsp;</p><p>Sample special with image in body. Sample special with image in body. Sample special with image in body. Sample special with image in body. Sample special with image in body.</p>','','wysiwyg'),('node','restaurant_special',0,26,26,'und',0,'<p>Learning to build web apps is hard without the necessary structure, support and guidance. We provide expert instruction, mentorship, and an immersive environment. You&#39;ll learn more in 3 months than most do in a year by attending Code Academy.<br />&nbsp;</p>','','wysiwyg'),('node','host_your_events_page',0,52,52,'und',0,'<blockquote><p>Boulder Creek did an amazing job hosting the wedding of Brigitte Stolicker and Ryan Roosien. The setting was beautiful yet intimate and the food was excellent! The manager of the Boulder Creek Golf Club was very accomodating and willing to help with whatever was needed! I would recommend this location and venue for a wedding reception! Beautiful!&nbsp;&nbsp;&nbsp; ---Jill Bergeron of Jill Bergeron Photography</p></blockquote><p>&nbsp;</p><blockquote><p>Boulder Creek did an amazing job hosting the wedding of Brigitte Stolicker and Ryan Roosien. The setting was beautiful yet intimate and the food was excellent! The manager of the Boulder Creek Golf Club was very accomodating and willing to help with whatever was needed! I would recommend this location and venue for a wedding reception! Beautiful!&nbsp;&nbsp;&nbsp; ---Jill Bergeron of Jill Bergeron Photography</p></blockquote><p>&nbsp;</p>','','wysiwyg'),('node','host_your_events_page',0,53,53,'und',0,'<p>Boulder Creek Golf Club is pleased to offer private and corporate events in our full-service banquet facility. We understand the importance of your event or special occasion and look forward to assisting you in all aspects of your function. Please feel free to call on us anytime at (616) 363-1330.</p><p>&nbsp;</p><p><strong>All arrangements for menus and other details must be finalized three (3) weeks prior to your event, with your event manager.</strong> Substitute or dietary plates may be ordered if done in advance, and will be billed at the same price as the main entrée. If menu is received by Boulder Creek less than two (2) weeks prior to date there will be a 5% charge added to your food bill.</p><p>&nbsp;</p><p><strong>A final guarantee of the number of attendees is required four (4) days prior to your function. </strong>This guarantee is not subject to reduction. In the event the guarantee is not received in the Club office, we will consider your last estimated number of attendees as the guarantee.</p><p>&nbsp;</p><h3><strong>Room Charges</strong></h3><ul><li>There is a $100.00 room charge on Fridays for parties under 100 and a $300.00 room charge for 100 and over. There will be a $500.00 room charge on Saturdays. Minimum number of guests is 100. Room charge covers the cost of set-up and teardown, dance floor, extra tables, table decorations, audio visual, etc. Also included for weddings are white linen.</li><li>A room usage charge may be applicable in some weekday cases due to group size or special needs of the function.</li><li>Wedding ceremony on premises is an additional $400.00. Room fee is $100.00 for formal set up on the deck including linen.</li><li>$50.00 fee for rental of projector, $.50/per person cake cutting fee and $.50 each for colored napkins.</li></ul><p>&nbsp;</p><p>The Club will assist you in any way possible with your individual needs for your function. All equipment brought in by any entertainment must be done (1) hour before the start of the event. It is the responsibility of the Host to make these arrangements with the entertainment in advance.</p><p>&nbsp;</p><p><strong>The Host is responsible for the conduct of their guests </strong>and assumes all responsibility for any and all damages to or loss of property from the function rooms or other areas of the Club caused by their guests, invitees or independent contractors affiliated with the function.</p><p>&nbsp;</p><p>Boulder Creek is a smoke free facility&mdash;smoking is allowed only in outside areas, such as patio or deck.</p><p>&nbsp;</p><p>Current prices are listed on the enclosed menus. Menu prices will be guaranteed 90 days prior to your event.</p><p>&nbsp;</p><p>The enclosed suggestions do not constitute the limits of our service or menu items that can be provided. We will be more than happy to accommodate you with your own &ldquo;special&rdquo; menu or service requirements.</p><p>&nbsp;</p><p>All Federal, State and Local laws with regard to food and beverage purchases or consumption are strictly adhered to. <strong>All food and beverages must be purchased from Boulder Creek Golf Club </strong>by pre-arrangement with our banquet manager. <strong>No food or beverages of any kind may be brought into Boulder Creek Golf Club</strong> by club members, guests or other invitees, with the exception of pre-approved specialty cakes, like wedding cakes. Boulder Creek Golf Club prepares food and beverages based on the guaranteed final count, in ample quantities to insure that all guests at the event enjoy an attractive selection of food.<strong> Leftover food or beverages may not be taken from the Club by the Host or guest of any event. </strong>All alcoholic beverages must be consumed within Club premises; open containers or glasses of such beverages may not be taken out of the Club.</p><p>&nbsp;</p><p><strong>On Fridays and Saturdays, all bands or other entertainers must finish their last set by eleven-thirty (11:30 pm) and all banquet rooms must be vacated by twelve (12:00 am). Last call will be given on all cocktail service no later than eleven (11:00 pm) Fridays &amp; Saturdays. Weekdays last call is at ten (10:00 pm) and closing at eleven (11:00 pm). Banquet room is available for a maximum of 6 hours. Luncheons must be finished by 3pm.</strong></p><p>&nbsp;</p><p><strong>We require that all guests intending to consume alcohol (including bride &amp; groom and bridal party) carry I.D. with them to the function.</strong> You will NOT be served without proper I.D. Boulder Creek Golf Club reserves the right to control all functions held within the Clubhouse and on Club premises, and to discontinue service of alcoholic beverages at any time, if, in the judgement of Club Management, it would be in the best interest of the Club, and the guest, to do so. In the event that alcohol service is terminated, it will not be construed that the function itself is over. The group will be welcomed to continue with the event with no alcohol available.</p><p>&nbsp;</p><p>Boulder Creek Golf Club does not have the space nor wishes to accept the responsibility of storing personal property, equipment or supplies belonging to or rented by the Host. All such items must be removed from the Club at the end of the function.<strong> Boulder Creek Golf Club will not assume or accept responsibility for damage to or loss of personal articles or rented equipment left in the Club prior to, during or following the function.</strong></p><p>&nbsp;</p><p>Rental equipment requested by the Host will be added to the final bill. The Host is responsible for lost, stolen or damaged rental equipment.</p><p>&nbsp;</p><p>On buffets for Children 5-10 there is a $3.00 discount in the price of the meal and children under 5 eat free. We request that small children be seated during the meal and be supervised if leaving the banquet room. Children&#39;s meal available upon request at $7.00 each.</p><p>&nbsp;</p><p>State fire regulations require that all candles must be enclosed in a hurricane lamp or glass shield. NO OPEN FLAMES. Decorations are not to be taped or tacked on walls, ceilings or surfaces. Table decorations and use of confetti must be pre-approved.</p><p>&nbsp;</p><p><strong>The Club will not be liable for failure to perform this contract as a result of strikes, fire, flood, failure of light, heat and air conditioning or any cause beyond our reasonable control.</strong></p><p>&nbsp;</p><p><strong>A non-refundable deposit of $300.00 for Fridays and $500 for Saturdays and a signed contract are required to reserve the date. The balance due must be paid in cash, personal, business or cashiers check at the end of the event, unless other arrangements have been made. There will be a 3% charge added to any banquet bill paid with a credit card.</strong></p><p>&nbsp;</p><p>All food, beverage and miscellaneous items are subject to a eighteen-percent (18%) gratuity and current Michigan sales tax.</p><p>&nbsp;</p><p>At the time of booking, a tax-exempt certificate for the State of Michigan must be submitted in order for the taxexemption to occur.</p>','','wysiwyg'),('node','host_your_events_page',0,54,54,'und',0,'<h3>RENTAL COMPANIES</h3><p><a href=\"http://www.dadstents.com/\" target=\"_blank\" title=\"DAD\'s Tents &amp; Party Rentals\">DAD&#39;s Tents &amp; Party Rentals</a></p><p>&nbsp;</p><h3>DJ&#39;S</h3><p>&nbsp;</p><h3>FLORIST</h3><p><a href=\"http://daylilyfloral.com/\" target=\"_blank\" title=\"Daylily Floral\">Daylily Floral</a></p><p>&nbsp;</p><h3>CAKES</h3>','','wysiwyg'),('node','golf_page',0,56,56,'und',0,'<p>This masterly crafted and diverse 18 Hole Championship course offers truly outstanding golf from the elevations of the front nine to the lush hills&nbsp;of the back nine.&nbsp; Boulder Creek is designed to challenge golfers of all skill levels.&nbsp; The par 72 golf course with 5 separate tee box areas, plays at 6949 yards from the black tees and 4949 yards from the forward tees.&nbsp; Concrete cart paths amble through the emerald fairways for a relaxing and picturesque day on the golf course.</p><p>&nbsp;</p><p>Daily Hours of Operation :&nbsp;&nbsp;<strong>April 2012</strong></p><p>Monday - Sunday:&nbsp; 9:00 am - 7:00pm</p><h6><br />Dress Code</h6><p>Proper attire is required on the golf course. For men, slacks, mid-length shorts and collared shirts are permitted. For women, skirts, slacks, mid-length shorts, collared tops with or without sleeves and non-collared tops with sleeves are permitted. Tank tops, halter tops or swim attire are not permitted.</p><h6><br />Spikeless Policy</h6><p>To improve the quality of play on our golf course metal spikes are not permitted. If any sets need to be changed over to the new spiking system our staff will change them for you, for a nominal fee.</p><p>&nbsp;</p><h6>Daily Fees</h6><table border=\"0\" class=\"rates\"><tbody><tr><td>&nbsp;2012 Rates:&nbsp; Through April 30</td><td width=\"5\">&nbsp;</td><td align=\"center\">9 Holes</td><td width=\"5\">&nbsp;</td><td align=\"center\">18 Holes</td></tr><tr><td>Weekday (Monday - Thursday)</td><td>&nbsp;</td><td align=\"center\">$25</td><td>&nbsp;</td><td align=\"center\">$35</td></tr><tr><td>Weekend (Friday - Sunday)</td><td>&nbsp;</td><td align=\"center\">$25</td><td>&nbsp;</td><td align=\"center\">$45</td></tr><tr><td>Senior (Monday - Friday before 12:00)</td><td>&nbsp;</td><td align=\"center\">$20</td><td>&nbsp;</td><td align=\"center\">$30</td></tr><tr><td>Senior (Saturday &amp; Sunday after 12:00)</td><td>&nbsp;</td><td align=\"center\">$25</td><td>&nbsp;</td><td align=\"center\">$35</td></tr></tbody></table><p>&nbsp;</p><ul><li>All fees stated include cart, which is not optional.</li><li>Senior age is&nbsp;60 years and older.</li><li>On holidays (as posted in the golf shop), weekend rates will apply.</li></ul>','','wysiwyg'),('node','page',0,57,57,'und',0,'<address>5750 Brewer Avenue N.E.</address><address>Belmont, Michigan 49306</address><p>&nbsp;</p><p>616-363-1330 phone</p><p>616-363-1339 fax</p><p>&nbsp;</p><h4><strong>131 North &amp; South Directions</strong></h4><ul><li>Take 131 to exit #91 (West River Dr.)</li><li>Turn Left at signal light</li><li>Go East for 5.5 miles</li><li>Turn Left at Brewer Ave., club is on the right</li></ul><p>&nbsp;</p><h4><strong>I-96 Directions</strong></h4><ul><li>Take exit #38 (East Beltline) and turn North</li><li>Continue North for 6.0 miles</li><li>Turn right on Cannonsburg Rd for 1.0 miles</li><li>Turn left on Brewer Ave., the club will be on the right</li></ul><p>&nbsp;</p><p><iframe frameborder=\"0\" height=\"150\" marginheight=\"0\" marginwidth=\"0\" scrolling=\"no\" src=\"http://maps.google.com/maps?q=Boulder+Creek+Golf+Club,+Plainfield+Township,+MI&amp;hl=en&amp;gl=us&amp;ie=UTF8&amp;view=map&amp;f=d&amp;daddr=5750+Brewer+Avenue+Northeast,+Belmont,+MI+49306+%28Boulder+Creek+Golf+Club%29&amp;geocode=CQ32O99ijAC3FY0nkQIdcVfm-iGxY9B9rdoDoQ&amp;t=m&amp;ll=43.073402,-85.58075&amp;spn=0.075237,0.177841&amp;z=11&amp;output=embed\" width=\"260\"></iframe><br /><small><a href=\"http://maps.google.com/maps?q=Boulder+Creek+Golf+Club,+Plainfield+Township,+MI&amp;hl=en&amp;gl=us&amp;ie=UTF8&amp;view=map&amp;f=d&amp;daddr=5750+Brewer+Avenue+Northeast,+Belmont,+MI+49306+(Boulder+Creek+Golf+Club)&amp;geocode=CQ32O99ijAC3FY0nkQIdcVfm-iGxY9B9rdoDoQ&amp;t=m&amp;ll=43.073402,-85.58075&amp;spn=0.075237,0.177841&amp;z=11&amp;source=embed\" style=\"color:#0000FF;text-align:left\">View Larger Map</a></small></p><p>&nbsp;</p><p>-------------------------------------------------------------------------------------------------------------------------</p><p>&nbsp;</p><h3><strong>LOCAL HOTELS</strong></h3><p>Radisson Hotel Grand Rapids Riverfront: 616-363-9001</p><p>Country Inn &amp; Suites: 616-942-7000</p><p>Courtyard Downtown: 616-242-6000</p><p>Comfort Suites: 616-785-7899</p>','','full_html'),('node','golf_page',0,58,58,'und',0,'<h6>Visit our beautiful 1400 square foot pro shop for all of your golfing needs. The elegant oak decor is stocked with the latest fashions for both men and women from fine makers such as Nike, adidas, Ashworth, Under Armour and many more.</h6><p>&nbsp;</p><p>Our PGA golf professionals will be glad to assist you with your apparel or equipment needs as well as improving your golf swing at our spacious practice center.</p><p>&nbsp;</p><p>The facility at Boulder Creek accepts major credit cards from Visa, American Express, Master Card, and Discover for those green fees or merchandise made from the golf shop.</p><p>&nbsp;</p><h5>Golf Club Rental</h5><p>Did you forget your clubs? Or maybe you would like to try out some of the latest equipment available on the market. The golf shop at Boulder Creek handles top name rental clubs and are available for $20 per round.</p>','','wysiwyg'),('node','golf_page',0,59,59,'und',0,'<p><strong>Bring your golf outing to Boulder Creek Golf Course and restaurant.&nbsp; Boulder Creek is a perfect getaway for your company and clients.&nbsp; We specialize in delivering a great experience for your corporate outings.</strong></p><p>&nbsp;</p><p>---------------------------------------------------------------------------------------------------------------</p><p>&nbsp;</p><h4>LOCAL HOTELS</h4><p>Amway Grand (Downtown Grand Rapids):&nbsp; 616-774-2000</p><p>Courtyard Marriot (Downtown Grand Rapids):&nbsp; 616-242-6000</p><p>Country Inn &amp; Suites (I-96 &amp; E. Beltline):&nbsp; 616-942-7000</p><p>Comfort Suites (US-131 &amp; West River Dr.):&nbsp; 616-785-7899</p>','','wysiwyg'),('node','golf_page',0,60,60,'und',0,'<p>The practice facility at Boulder Creek is one of the largest driving ranges and learning centers you will find in the area. We offer over 60,000 square feet of hitting surface to help you mold those long and accurate tee shots. Let our target greens help your game in developing those precise iron and scoring shots.</p><p>&nbsp;</p><p>Practice your short game skills by using our practice bunker &amp; pitching area. Then...when you\'re ready to sharpen up on your putting touch, step over to our large 9,000 square foot putting green. The putting green is over 120 feet in length to help develop your touch on those extra long putts. Our PGA golf professionals are available to help golfers of all skill levels. Please consult the golf shop for further details.</p><p>&nbsp;</p><p><strong>Range Balls</strong><br />$5.00 per bucket (approx. 40 golf balls)</p><p>Junior Golfers - 17 and under -Half Price- when accompanied with an adult.</p><p><strong>Practice Facility Advantage Card</strong><br />10 Baskets - $40</p><p>&nbsp;</p><p><strong>Range Membership Plans</strong></p><p>Boulder Creek Golf Club offers annual fees for the practice facility within scheduled operating hours. An individual plan is $275.00 and a family plan is $375.00. Members of the plan may hit unlimited range balls during range hours of operation. Guests of program participants must purchase range balls separately. Please inquire in the pro shop for more details.</p><p><strong>&nbsp;</strong></p><p><strong>Instruction</strong></p><table class=\"rates\" border=\"0\"><tbody><tr><td>&nbsp;</td><td width=\"5\">&nbsp;</td><td align=\"center\">Amy Pollack<br />PGA Professional<br /></td><td align=\"center\">&nbsp;</td><td align=\"center\">Steve Gilbert<br />PGA Apprentice<br /></td></tr><tr><td>Regular: 1/2 hour</td><td>&nbsp;</td><td align=\"center\">$50</td><td align=\"center\">&nbsp;</td><td align=\"center\">$40</td></tr><tr><td>Playing</td><td>&nbsp;</td><td align=\"center\">$75</td><td align=\"center\">&nbsp;</td><td align=\"center\">$60</td></tr><tr><td>Mini Series of 3: 1/2 hour</td><td>&nbsp;</td><td align=\"center\">$130</td><td align=\"center\">&nbsp;</td><td align=\"center\">$100</td></tr><tr><td>Junior Golfers (17 &amp; Under)</td><td>&nbsp;</td><td align=\"center\">$40</td><td align=\"center\">&nbsp;</td><td align=\"center\">$20</td></tr></tbody></table><p>&nbsp;</p><p><strong>Clinics</strong><br />Clinics for all levels of golfers, are offered periodically during the year. Please contact the golf shop for specific dates &amp; times.</p><p>&nbsp;</p><p><strong>Couples Twilight</strong><br /><a href=\"/sites/default/files/2012_couples_league_info.pdf\" target=\"_blank\">Click here for details and dates.</a>&nbsp;</p><p><strong>Junior Golf Program</strong><br /><a href=\"/sites/default/files/junior_2012.pdf\" target=\"_blank\">Click here for Junior League details and dates.</a></p><p><a href=\"/sites/default/files/2012_junior_golf_clinics.pdf\" target=\"_blank\">Click here for Junior Clinic details and dates.</a></p>','','wysiwyg'),('node','restaurant_special',0,61,61,'und',0,'<p>It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>','','wysiwyg'),('node','restaurant_special',0,62,62,'und',0,'<p>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source.</p>','','wysiwyg'),('node','event',0,64,64,'und',0,'Iriure nobis oppeto refoveo wisi. Commoveo euismod iaceo melior neo qui quis tincidunt tum vicis. Consequat defui inhibeo lenis mauris quia utinam. Importunus odio quadrum quibus sed. Defui exerci facilisi iustum luptatum meus pecus persto pneum.\n\nAppellatio dolor meus nibh velit vero. Eu mos quibus refero roto vindico wisi. Cui decet dignissim immitto lobortis lucidus macto nisl saepius uxor. Bene camur in singularis.\n\nCamur elit ex in populus quia utrum voco. Haero humo oppeto sagaciter ullamcorper ut wisi. Consectetuer eligo exerci haero inhibeo praemitto rusticus torqueo vindico zelus.\n\nAliquam aliquip antehabeo. Accumsan importunus nobis occuro probo quidem. Cogo erat luctus ludus proprius similis tincidunt utrum velit vereor. Capto et eum jumentum lobortis ludus patria paulatim sino sit.\n\nAccumsan modo molior nimis utrum zelus. Accumsan antehabeo hendrerit humo iustum laoreet praemitto proprius. Cogo hos lenis meus oppeto refero tation. Eros iriure melior singularis. Haero hendrerit in magna minim nimis quae sagaciter. Damnum dolore jus mos neo oppeto quae sino vereor.\n\nIn lucidus luptatum uxor. Abico acsi dolor hos loquor macto molior neque refero te. Adipiscing eum neo. Lenis letalis obruo probo. Loquor nostrud pecus praemitto. Diam esca genitus humo illum singularis valetudo veniam vulputate. Aliquam appellatio camur distineo lenis nisl turpis verto. Augue commodo elit iusto lenis nulla pagus. Eu nimis roto. Defui ibidem probo ullamcorper. Aliquam capto facilisi haero illum macto paratus turpis.\n\nLudus magna nibh. Brevitas erat ratis. Br