auctor.</p>','','full_html'),('node','golf_page',0,10,10,'und',0,'<h3>2012 Golf Membership Plans</h3><p>Golf memberships are good for calendar year they were purchased in.</p><p><strong>&nbsp;</strong></p><p><strong>Boulder Creek Partners Club*</strong></p><p>10 18-Hole Rounds with Cart = $450.00</p><p>20 18-Hole Rounds with Cart = $850.00</p><p>50 18-Hole Rounds with Cart = $2,000.00</p><p>&nbsp;</p><p><strong>Boulder Creek Senior Partners Club**</strong></p><p>10 18-Hole Rounds with cart = $250.00</p><p>10&nbsp;9-Hole Rounds with cart = $170.00</p><p>20 18-Hole Rounds with cart = $480.00</p><p>^10 18-Hole Rounds with cart at anytime = $350.00</p><p>&nbsp;</p><p>Reminder: Senior Partners Club 18 hole rounds must be used as 18 holes and <strong><em>cannot</em></strong> be split.&nbsp; We are now also offering a Senior Partners Club 9 hole package for those Seniors wanting to play 9 holes.</p><p>&nbsp;</p><p><strong>Boulder Creek Partners Club Unlimited Individual Partner</strong></p><p>Unlimited with cart = $1,800.00</p><p>Individual &amp; Spouse = $3,000.00</p><p>Add Children (17 &amp; Under) for $500.00 per person</p><p>&nbsp;</p><p><strong>2012 Promotions</strong></p><p><a href=\"/sites/default/files/2012_promotions_flier.pdf\" target=\"_blank\">Please click here to see promotions available.</a></p><p>&nbsp;</p><p>* Rounds are good anytime 7 days a week. Good After 12:00 PM on Holidays.</p><p>**Senior Rounds are good Monday-Friday before Noon, Holidays after 12:00pm</p><p>^Senior Anytime Partners are good any day of the week.</p><p>&nbsp;</p><p><strong>Range Membership Plans</strong></p><p>Boulder Creek Golf Club offers annual fees for the practice facility within scheduled operating hours. An individual plan is $275.00 and a family plan is $375.00. Members of the plan may hit unlimited range balls during range hours of operation. Guests of program participants must purchase range balls separately. Please inquire in the pro shop for more details.</p>','','wysiwyg'),('node','restaurant_page',0,12,12,'und',0,'<h3>RESTAURANT MENU</h3><p>&nbsp;</p><h3>GOLF OUTING MENU</h3><p>&nbsp;</p><h3>BEVERAGE MENU</h3><p><strong>BEER</strong></p><p>Draft:</p><p>Miller Lite - Pow Wow Pale Ale - Mt. Pleasant Brewing Co. Train Wreck</p><p>McSorley&#39;s Irish Lager - Bell&#39;s Oberon - Leinenkugel&#39;s Summer Shandy</p><p>Cans:</p><p>Miller High Life - Pabst Blue Ribbon - Carling&#39;s Black Label $2.00</p><p>Bud Light, Budweiser, Bud Light Lime, Coors Light, MGD 64, Miller Lite, Michelob Ultra - $3.00</p><p>Newcastle, Heineken, Corona, Labatt Blue, Labatt Blue Light, Shock Top, Leinenkugel&#39;s Summer Shandy &amp; Sunset Wheat - $3.50</p><p>Mike&rsquo;s Hard Lemonade, Lime, Cranberry - $4.00</p><p>Guinness Draft Can - $4.00</p><p>Fosters Oil Can (25.4oz), - $4.50</p>','','wysiwyg'),('node','restaurant_page',0,13,13,'und',0,'<p>ccdscds</p>','','wysiwyg'),('node','restaurant_page',0,14,14,'und',0,'<p>czcvdscv</p>','','wysiwyg'),('node','event',0,15,15,'und',0,'<p>onsectetur adipiscing elit. Nulla fringilla auctor nibh nec cursus. Phasellus quis felis vulputate mi dictum tristique. Nulla tristique magna sed nisi faucibus malesuada. Nam id eleifend tellus. Etiam et leo id est tempor scelerisque. Cras consequat porttitor tincidunt. Quisque feugiat orci pulvinar lacus auctor imperdiet. In neque elit, varius tempor dignissim eget, faucibus nec orci. Praesent nisl mi, consequat et vestibulum eu, pulvinar et ante. Vivamus fermentum dictum orci, ac pellentesque est porttitor et. In venenatis velit tortor. Sed aliquet orci quis nibh commodo elementum. Aenean dignissim pretium ante ac tincidunt. Nam diam dolor, adipiscing non ornare non, venenatis vel risus. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Vestibulum quis nibh dui, ac pellentesque tellus.</p>','','wysiwyg'),('node','event',0,16,16,'und',0,'<p>onsectetur adipiscing elit. Nulla fringilla auctor nibh nec cursus. Phasellus quis felis vulputate mi dict